    borderRadius: '50%',
    objectFit: 'cover',
    border: '3px solid white',
    flexShrink: '0',
  },

  title: {
    fontSize: 'clamp(1.3rem, 2vw, 1.8rem)',
    fontWeight: 'bold',
    margin: '0',
    color: '#333',
    whiteSpace: 'nowrap',
    overflow: 'hidden',
    textOverflow: 'ellipsis',
  },

  buttonsContainer: {
    display: 'flex',
    alignItems: 'center',
    gap: '15px',
    flexWrap: 'wrap',
    justifyContent: 'flex-end',
    flex: '1',
    minWidth: '250px',
  },

  dropdownContainer: {
    position: 'relative',
    minWidth: '200px',
    flex: '1',
    zIndex: 100,
  },

  networkButton: {
    backgroundColor: '#5a6268',
    color: 'white',
    padding: '12px 20px',
    fontSize: '1rem',
    border: 'none',
    borderRadius: '8px',
    cursor: 'pointer',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'space-between',
    gap: '10px',
    whiteSpace: 'nowrap',
  },

  regionsDropdown: {
    position: 'absolute',
    top: '100%',
    backgroundColor: 'white',
    minWidth: '100%',
    borderRadius: '8px',
    boxShadow: '0 5px 15px rgba(0,0,0,0.2)',
    marginTop: '5px',
    overflow: 'hidden',
    zIndex: 100,
  },

  regionItem: {
    padding: '12px 20px',
    color: '#333',
    cursor: 'pointer',
    transition: 'background-color 0.2s',
    '&:hover': {
